var Grape=function(t){this.FN_ARGS=/^function\s*[^\(]*\(\s*([^\)]*)\)/m,this.dependencies=t||{}};Grape.prototype.getDependencies=function(t,e){return t.map(function(t){return e[t]})},Grape.prototype.extractArguments=function(t){return t.toString().match(this.FN_ARGS)[1].split(", ").join(",").split(",")},Grape.prototype.inject=function(t){var e=this.extractArguments(t);return t.apply(t,this.getDependencies(e,this.dependencies))};